import { CardContainer, Card, Title, CardPreview } from '../styled-components/CardElements'

const CardList = ({ cards, title }) => {
  return (
    <CardContainer>
      <Card>
        <Title>{ title }</Title>
        {cards.map((card) => (
          <CardPreview key={card.petCard._id}>
            <p>{ card.petCard.status }</p>
            <h2>{ card.petCard.petName }</h2>
            <p>{ card.petCard.breed }</p>
            <p>{ card.petCard.species }</p>
          </CardPreview>
        ))}
      </Card>
    </CardContainer>
  )
}

export default CardList;
